import React from 'react';
import './Joul.css';
import WorkTitle from './WorkTitle/WorkTitle';
import { WorkOne } from './WorkTitle/Data';
import {Helmet} from 'react-helmet';

function Joul(props) {
    let className = props.primary ? 'primary' : ''
    return (
        <>


        <div className={className}>
        <p>Hello</p>
        <WorkTitle {...WorkOne} />
        </div>
        </>
    );
}

export default Joul;
